css:
@-moz-document domain(freecrimea.com.ua) {
  /* Large version of logo */
  .logo {
    display: block;
    width: 616px;
    height: 88px;
    background-repeat: no-repeat;
    background-size: cover;
    background-image: url("data:image/png;base64,");
  }

  .logo img {
    display: none;
  }

  /* remove unnecessary min-width rule */
  body {
    min-width: inherit;
  }

  /* remove horizontal scroll */
  .sidebar {
    overflow: hidden;
  }

  /* enlarge image width */
  #ctl00_PanelAdv_img_adv {
    width: 100% !important;
  }

  /* add vertical margin */
  .block-tabs {
    margin-top: 20px !important;
  }

  /* remove unnecessary styling */
  .widget-tweets {
    height: auto !important;
    border: 0 !important;
    margin-bottom: 20px !important;
  }

  .widget-tweets .title {
    display: none !important;
  }
}
